        self.grpAlgoParams.setToolTip(_translate("Dialog", "<html><head/><body><p>This is a Random Forest Classifier. This consists of a large number of individual decision trees that operate as an ensemble. Each individual tree in the random forest spits out a class prediction and the class with the most votes becomes our model’s prediction.</p></body></html>"))
        self.grpAlgoParams.setTitle(_translate("Dialog", "Random Forrest Classifier Parameters:"))
        self.label.setText(_translate("Dialog", "n_estimators"))
        self.edtN_Estimators.setToolTip(_translate("Dialog", "<html><head/><body><p>Number of trees the algorithm builds before taking the maximum or averages of predictions. In general, a higher number of trees increases the performance and makes the predictions more stable, but it also slows down the computation.</p></body></html>"))
        self.edtN_Estimators.setText(_translate("Dialog", "200"))
        self.label_2.setText(_translate("Dialog", "max_features"))
        self.edtMaxFeatures.setToolTip(_translate("Dialog", "<html><head/><body><p>The number of features considered when looking for the best split:</p><p>If an integer value: consider max_features features at each split.<br/>If a decimal value: max_features is a fraction and round(max_features * n_features) features are considered at each split.<br/>If “auto”, then max_features=sqrt(n_features).<br/>If “sqrt”, then max_features=sqrt(n_features) (same as “auto”).<br/>If “log2”, then max_features=log2(n_features).<br/>If None, then max_features=n_features.</p><p>Note: the search for a split does not stop until at least one valid partition of the node samples is found, even if it requires to effectively inspect more than max_features features.</p></body></html>"))
        self.edtMaxFeatures.setText(_translate("Dialog", "auto"))
        self.chkBootstrap.setToolTip(_translate("Dialog", "<html><head/><body><p>Whether bootstrap samples are used when building trees. If False, the whole dataset is used to build each tree.</p><p>When training, each tree in a random forest learns from a random sample of the data points. The samples are drawn with replacement, known as bootstrapping. This means that some samples will be used multiple times in a single tree. The idea is that by training each tree on different samples, although each tree might have high variance with respect to a particular set of the training data, overall, the entire forest will have lower variance but not at the cost of increasing the bias.</p><p>At test time, predictions are made by averaging the predictions of each decision tree. This procedure of training each individual learner on different bootstrapped subsets of the data and then averaging the predictions is known as bagging, short for bootstrap aggregating</p></body></html>"))
        self.chkBootstrap.setText(_translate("Dialog", "Bootstrap:"))
        self.label_4.setText(_translate("Dialog", "max_depth"))
        self.edtMaxDepth.setToolTip(_translate("Dialog", "<html><head/><body><p>The maximum depth of the tree. If None, then nodes are expanded until all leaves are pure or until all leaves contain less than min_samples_split samples</p></body></html>"))
        self.edtMaxDepth.setText(_translate("Dialog", "110"))
        self.label_5.setText(_translate("Dialog", "min_samples_leaf"))
        self.edtMinSamplesLeaf.setToolTip(_translate("Dialog", "<html><head/><body><p>The minimum number of samples required to be at a leaf node. A split point at any depth will only be considered if it leaves at least min_samples_leaf training samples in each of the left and right branches. This may have the effect of smoothing the model, especially in regression.</p><p>  If int, then consider min_samples_leaf as the minimum number.<br/>  If float, then min_samples_leaf is a fraction and ceil(min_samples_leaf * n_samples) are the minimum number of samples for each node.</p></body></html>"))
        self.edtMinSamplesLeaf.setText(_translate("Dialog", "4"))
        self.label_6.setText(_translate("Dialog", "min_samples_split"))
        self.edtMinSamplesSplit.setToolTip(_translate("Dialog", "<html><head/><body><p>The minimum number of samples required to split an internal node:</p><p>If int, then consider min_samples_split as the minimum number.<br/>If float, then min_samples_split is a fraction and ceil(min_samples_split * n_samples) are the minimum number of samples for each split</p></body></html>"))
        self.edtMinSamplesSplit.setText(_translate("Dialog", "5"))
        self.grpDates.setTitle(_translate("Dialog", "Analysis Period:"))
